eye_light = ""

search_dark = ""

search_light = ""

loading = ""

default_splash = ""

green_circular_check_mark = ""

red_circular_cross_mark = ""

folder = ""


from source.framework.pool import Pool
from PyQt5.QtGui import QIcon

class IconManager:

    def get_icon(self, name, theme_based=True, return_pixmap=False, return_byte_array=False):
        if theme_based:
            if not Pool.get('user_setting'):
                theme_index = 2 # light theme default
            else:
                theme_index = Pool.get('user_setting').get('theme')

            if theme_index == 1: theme = 'light'  # dark theme is active, retuen light picture
            elif theme_index == 2: theme = 'dark'
            
            icon_name = str(name) + '_' + theme
        else:
            icon_name = name
        try:
            icon = eval(icon_name)
            pm = QPixmap()
            pm.loadFromData(base64.b64decode(icon))
            if return_pixmap: 
                return pm
            elif return_byte_array:
                return QByteArray.fromBase64(icon)
            else: 
                return QIcon(pm)
        except:
            return None
